import React from 'react';
import { Link } from 'react-router-dom';


function Header() {
  return (
    <div className='header'>
        <div className='logo'>
            <h1>SnapLib</h1>
        </div>
        <div className='navb'>
            <ul>
                <li>
                    <Link to="">Home</Link>
                </li>
                <li>
                    <Link to="">Home</Link>
                </li>
                <li>
                    <Link to="">Home</Link>
                </li>
                
            </ul>
        </div>
    </div>
  );
};

export default Header;
